        "cellValue": "<p>矿业公司:1、高品位选矿量：高质块矿月计划5000吨（块）当日60吨/累计621吨，高质粉矿月计划18000吨（粉）当日363吨/累计3730吨，中硫混合矿月计划63000吨，当日1316吨/8281吨。</p><p> &nbsp; &nbsp; &nbsp; &nbsp;2、猫场综掘机：综掘机因当前无掘进工作面暂停运行。凿锚机：工作面N1230-20-2运行7小时，锚网支护1.8米、用网片6张，锚杆14根。管缝式锚网台车：工作面1230N27运行4小时，锚网支护1.7米、网片6张、锚杆17根。树脂锚网台车：工作面1230EN6采场运行5小时，锚网支护1.7米、网片6张、锚杆17根。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p> &nbsp; &nbsp; &nbsp; &nbsp;3、7日外销计划2400吨：其中林歹发华锦900吨、猫场发华锦高硫粉矿1500吨。 </p><p>矿石生产、交库欠进度：坛罐窑剥离中、小长冲河矿石累量后集中交库。</p><p>矿石销售欠进度：1、华锦校磅、多品种矿石竞价中。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>合金事业部:1、进XX678.3吨/4588.34吨;其中圆棒进XX55.98吨/511.76吨,扁锭进XX543.72吨/3188.76吨，铸造合金进XX78.6吨/609.4吨，线杆进XX0吨/278.42吨。</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2、合金销售欠进度：客户货款未到，影响发运量。</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3、合金进XX欠进度：月初进XX量超，华仁今日扣除，实进61包。</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4、废XX消纳101.42吨/783.33吨，其中外购废XX消纳73.6吨/441.3吨，渣房锭消纳8吨/48吨。 </p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 5、6日1:00 &nbsp;9号线订单生产完毕停炉。</p><p>质检化验中心：7日10:00-11:00将对猫场矿1号、2号地磅进行校磅，期间车辆过磅会受到影响。 </p><p>XX加工业务部：1、喷涂材未组织入库：待基材累量后集中喷涂入库。</p><p> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2、型材未组织销售：待客户打款后集中发运。</p>",
